import React from 'react';
import Logo from '../shopclone'

const home = () => {
    return (
        <div className="container">
            <h4 className="center">
                Hello. this is the home page
            </h4>
            <img class="responsive-img" src="Logo"/>

        </div>
    )
}

export default home
